거실바닥에 나뒹구는 실내화들 보기 싫어서 구매했어요
일단 정리되서 너무 좋은데...
이 남편이란 사람이 걸어놓질않고 아무대나 벗어놔서....ㅡㅡ;;

두개를 시켰는대 하나는 제대로 왓는대 하나가 막대기 1세트가 없네요 ㅎㅎ;;
맨아래고정시키는거랑 맨위에박는거가 두개 왓네요 ㅎㅎ;;
조립은 다햇는대 어떡하죠? ㅎㅎ;;

방수판인가요? 조립을 위해 잡아당겼더니 다 뜯어지네요
한장도 아니고 두장이요..
그래도 한번 써볼려고 바느질로 꼬매봤는데 잡아당기니
다 뜯어지네요;;;
그냥 반품하면 되는것을.. 내가 왜 꼬맸을까;;;
그냥 버려야 할듯 ㅠ

다른건 다 상품설명과 비슷함. 그런데 몸통부분 조립하고 몸통이랑 입구뚜껑부분 끼우는게 이게 진짜 책받침 같은 얇기라 진짜 네모서리를 맞춰서 딱 끼우는게 너무 힘듬. 30분에 하나 끼워질까 말까임. 어제부터 조립중인데 뚜껑끼우다 미쳐돌기직전.
돈을 더 받으시더라도 좀 빳빳하고 두껍게 만들어주세여.
하루면 될줄 알았던 신발장 조립이 일줄은 넘게 걸리게 생겨씀..;;

귀찮아서 그냥 쓰는데 두껑이 찌그러져서 왓어요;;;
그리고 생각보다 너무 얇고 ..
급해서 그녕 쓰는데 두번은 구매 안할것같아요

설치 했는데, 선반 끝에 돌려서 미세하게 남은 거리를 메꾸는,, 그거가 헛 돌아요;;;
하나는 잘 도는데, 한쪽은 헛 도네요.

환불 받고, 제품 하자 밝혀 내는게 더 복잡할거 같아서 대충 고정해 놓고 써요

하나는 잘 돌아서 그나마 고정은 되고 있어요;;

좀 어정정하고 아쉽네요~^^;;
특히 맨아래칸이 쓸모가 없어요~ㅠㅠ결론은 두칸만 사용~
결론은 두컬레만 가능

생각보다 약하고 별로입니당...ㅎㅎㅎ;;
후기가 좋길래 사봤는데
기대하지 마시고 구입하세용

와... 이거 내가 사이즈 와.. 진짜;

무슨 맞춤형으로 나왔나 이럴 수 잏흠까

거즌 집주인분과 한통속; 쏘옥ㅡ 뚝딱

@조립 : 쉬움 그리고 다른 저렴이 조립 가구보다 좋은 점이 암나사가 나무 안쪽에서 pvc 재질같은 바디가 매립되어있는게 아니라 메탈 바디가 매립되어있어서 조일때 힘을 더 안전하게 받음 조립은 신랑찬스 드라이버 하나로 5분정도면 함 ( 여자였어도 비슷 )
@배송상태 : 빠르고 깨끗하게 왔음 조립가구를 많이 써본탓에 조금씩 여러군데에서 조여들어가서 삐뚤게 조립한 적이 없는편인데 다른곳은 다 90도 정각 딱딱 잘 맞는데 한군데가 미묘—-~~~ 하게 안맞음 근데 그것땜에 비뚤어져 있다던가 시야에 거슬린다던가 하는편이 아니라 괜찮음 내가 좀 예민한 편일뿐 그리고 이런 제품은 창고에서 오래 있었으면 휘어있을수도 있는데 제작한지 얼마 안됬던지 관리가 잘 되어있나봄 휘어있는 나무판은 없었음 가루날림도 없고
@안착감 : 신발벤치라 오래 앉을건 아니지만 그래도 여자 스타킹 신고 앉을때라던지 남자도 허벅지가 길이가 길기 때문에 숙여서 신발 신을때 의자에 닿는 허벅지 중간부분이 아플수도 있잖슴?
근데 적당함 여자들 스타킹 걸릴만한 부분도 없고
@안정성 : 벽에 기대어 놓던지 미끌어지지 않는 재질 위에 놔두던지 해야함 아니면 미끌림 방지 고무 덧대어 놓던지 난 벽에 기대어 놓고 코일매트 깔거라 상관없지만 타일이나 에폭시 바닥이면 미끌어짐
장판이라면 벤치 무게에 사람 무게 더하면 안미끌리겠지만 자국이 남을테고, 그리고 요즘 강화장판이라면 밀릴수도. 난 이부분에서 가격이 싸고 , 해당사항 아니니 패스
@ 280 남자 신발도 커버함 가성대비 좋고 편해서 전 좋아요 별 다섯개

봉들이 지혼자 빠져있어서 신발들 난리남;
다시 끼워도 또 빠지고; 걍 무너진채로 쓰고있어요ㅋ
다른거 살껄 후회중

이가격에....제가 뭘 바랬을카요..ㅎ

참 아이디어가 좋다는 싶은데....
제가 원하던 스탈은 아니네요;;;;;;
배송도 넘 오래걸렸구요ㅜ
인테리어에 맞지않아서 창고방에 숨겨둬야겠어여;;;

우선 사이즈 가로26.5가 아니고 29입니다; 표기랑 틀립니다 실측입니다 제가 제봤습니다
수평도 안맞아요 되게 덜렁덜렁 거림 딸랑인줄

조립은 쉬우나 이것들이 아다리가 잘 안맞는지 힘을 써서 강제로 마추면서 해야합니다 여성분들은 장갑착용하시고 조립하셔야할거같아요 위험합니다. 그냥 싼맛에 쓰렵니다 저도 조립해서 다시 분해하기 귀찮;

모양이랑 사이즈는 좋은데
조립하던중 길이가 다른 기둥이 하나있어서 칸하나를 못쓰게됫네여;;
플라스틱이라 좀 흔들리긴하지만 그대로 쓰러질것같진 않아요

좁은 현관에 신발장으로 두기 좋아요!
사용설명서가 없다는 걸 모르고 주문해서;;
처음에 조금 당황했는데 쉽게 조립할 수 있는 것 같네요^^

저렴한 가격에 잘 구매했습니다. 간격도 넓어서 사용하는데에 편하고, 군더더기 없는 디자인에 마감도 날카롭지않네요. 다만,
택배발송 주문상품을....덜렁 상자에;; 입구를 테잎으로 막지도 않고,
날것(?)으로 보내 주셨네요;; 집 앞 마트에서 사와도.. 뜯지 못하게 테잎으로 상자 입구를 붙이기 마련인데요;;
배송 오다가 상품이 밖으로 안빠져 나온게 신기 할 따름입니다;;;;;

신발 네 개 정도 올리기에 딱 좋아요.
근데 발 받침대를 안 보내주셨어요 ㅠㅠ
바닥에 깔고 놓고 있는데, 신발장 사서 쓰는 의미가 좀 무색해지네요;;

양쪽으로 길게 쓰다가 공간협소하면 위로 이층 쌓아 쓸요량으로 두개를 주문했는데...두개 사이즈가 각각 틀리네요ㅠㅠ
박스포장에 동일사이즈로 포기되어있었는데 말이죠!
그냥 양쪽으로 놓고 쓰고있어요^^;;;;;;

두 번째 구매했어요. 전에 구매한 거 위로 올리려니 아래것들이 막 휘려고 해서 포기하고 옆으로 나란히 두었습니다.
봉이나 지지대 플라스틱이 너무 약하네요.
그냥 쓰긴 정말 무난하지만 너무 약하다는 게 함정~위로 쌓아 올려도 끄떡없게끔 조금 더 튼튼하게 만드시고 가격을 조금 올리셔도 잘 팔릴 것 같은데요. ^^;;;

저렴한 가격에 가성비값이라 구매했는데 중국제품이였네요^^;
다행이 불량없이 잘 도착했어요.
조립내내 손에 새까맣게 묻어나서 식겁했네요;;
꾹꾹눌러 단단히 조립하니 잘 맞아떨어지고 튼튼하네요.

기존에 5단 있어서 위로 3단 더 추가구입했어요
근데 맨 5단의 맨위에가 무쓸모가 되네요;;
총 8단이 되에야하는데
총7단이 되어버림;;;
이것이 중소기업의 한계인가..
